Location:
class Location(Entity):
    """Geographical entities such as geographical areas and landmasses, bodies of water"""
    def __init__(self, name: str):
        super().__init__(name=name)

Organization:
class Organization(Entity):
    """Corporations, agencies, and other groups of people defined by an established organizational structure. An Organization entity may be a single organization or a group."""
    def __init__(self, name: str):
        super().__init__(name=name)

People:
class People(Entity):
    """People entities are limited to humans. A People entity often is a single person."""
    def __init__(self, name: str):
        super().__init__(name=name)
